import React, {useState} from "react";

const SnackGame = () => {
    let blockMaping = require('../../json/maping.json');
    return(
        <div>
            {
                blockMaping.map((value)=>{
                    return(
                        <div id ={value.block} data-for-ladder = {value.ladder} data-for-snack = {value.snake}></div>
                    )
                })
            }
        </div>
    )
}
export default SnackGame
